import { useSelector, useDispatch } from "react-redux";
import { BrowserRouter as Router, Route } from "react-router-dom";
import { logIn } from "./store/login-actions";
import { testioActions } from "./store/testio-slice";

import LoginPage from "./components/LoginPage/LoginPage";
import HomePage from "./components/HomePage/HomePage";
import "./index.css";

function App() {
  const dispatch = useDispatch();
  const testio = useSelector((state) => state.testio);

  const logOutHandler = () => {
    dispatch(testioActions.confirmLogout());
  };

  const homePage = (
    <Route
      exact
      path="/home"
      component={() => <HomePage Logout={logOutHandler} />}
    />
  );

  const loginPage = <Route path="/" component={() => <LoginPage />} />;

  return (
    <Router>
      <div>{testio.token ? homePage : loginPage}</div>
    </Router>
  );
}

export default App;
